  true,\n\t\"url\": null,\n\t\"notes\": \"These rates are the daily secondary market
  quotation on the most recently auctioned Treasury Bills for each maturity tranche
  (4-week, 13-week, 26-week, and 52-week) that Treasury currently issues new Bills.
  Market quotations are obtained at approximately 3:30 PM each business day by the
  Federal Reserve Bank of New York. The Bank Discount rate is the rate at which a
  Bill is quoted in the secondary market and is based on the par value, amount of
  the discount and a 360-day year. The Coupon Equivalent, also called the Bond Equivalent,
  or the Investment Yield, is the bill's yield based on the purchase price, discount,
  and a 365- or 366-day year. The Coupon Equivalent can be used to compare the yield
  on a discount bill to the yield on a nominal coupon bond that pays semiannual interest.\",\n\t\"license_title\":
